(1, 47, 'Typography', 'typography', '<p>It is possible with templates which have a typography page to show you how you can use e.g. headline tags in order to structure your content in a better way. Below, we present rebuilt and refreshed typographical aspects of Gavern Framework. In order to use it, you have to use a plug in which is delivered in a package with a template or use HTML code.</p>\r\n<div id="warnings" class="demo-typoDiv typoDesc">\r\n<h4 class="demo-typo">Warnings</h4>\r\n<p class="gkInfo1">Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vestibulum venenatis orci non tortor accumsan...</p>\r\n<p class="gkTips1">Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vestibulum venenatis orci non tortor accumsan...</p>\r\n<p class="gkWarning1">Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vestibulum venenatis orci non tortor accumsan...</p>\r\n</div>\r\n<div class="demo-typoDiv">\r\n<h4 class="demo-typo">Headings</h4>\r\n<div class="demo-typo_padd">\r\n<h1>This is heading 1</h1>\r\n<h2>This is heading 2</h2>\r\n<h3>This is heading 3</h3>\r\n<h4>This is heading 4</h4>\r\n<h5>This is heading 5</h5>\r\n<h6>This is heading 6</h6>\r\n</div>\r\n</div>\r\n<div class="demo-typoDiv typoDesc">\r\n<h4 class="demo-typo">Icon set</h4>\r\n<div class="demo-typo-col3">\r\n<div class="demo-typo_padd">\r\n<p class="gklink"><strong>gklink</strong> message <br /> <small>Use &lt;p class="gklink"&gt;Txt...&lt;/p&gt;</small>.</p>\r\n<p class="gkinfo"><strong>gkinfo</strong> message <br /> <small>Use &lt;p class="gkinfo"&gt;Txt...&lt;/p&gt;</small>.</p>\r\n<p class="gkpin"><strong>gkpin</strong> message <br /> <small>Use &lt;p class="gkpin"&gt;Txt...&lt;/p&gt;</small>.</p>\r\n<p class="gkfile1"><strong>file1</strong> message <br /> <small>Use &lt;p class="gkfile1"&gt;Txt...&lt;/p&gt;</small>.</p>\r\n<p class="gkfile2"><strong>kfile2</strong> message <br /> <small>Use &lt;p class="gkfile2"&gt;Txt...&lt;/p&gt;</small>.</p>\r\n<p class="gksettings"><strong>gksettings</strong> message <br /> <small>Use &lt;p class="gksettings"&gt;Txt...&lt;/p&gt;</small>.</p>\r\n</div>\r\n</div>\r\n<div class="demo-typo-col3">\r\n<div class="demo-typo_padd">\r\n<p class="gkmic"><strong>gkmic</strong> message <br /> <small>Use &lt;p class="gkmic"&gt;Txt...&lt;/p&gt;</small>.</p>\r\n<p class="gkvideo"><strong>gkvideo</strong> message <br /> <small>Use &lt;p class="gkvideo"&gt;Txt...&lt;/p&gt;</small>.</p>\r\n<p class="gkvoice"><strong>gkvoice</strong> message <br /> <small>Use &lt;p class="gkvoice"&gt;Txt...&lt;/p&gt;</small>.</p>\r\n<p class="gklocked"><strong>gklocked</strong> message <br /> <small>Use &lt;p class="gklocked"&gt;Txt...&lt;/p&gt;</small>.</p>\r\n<p class="gkunlocked"><strong>gkunlocked</strong> message <br /> <small>Use &lt;p class="gkunlocked"&gt;Txt...&lt;/p&gt;</small>.</p>\r\n<p class="gkstats"><strong>stats</strong> message <br /> <small>Use &lt;p class="gkstats"&gt;Txt...&lt;/p&gt;</small>.</p>\r\n</div>\r\n</div>\r\n<div class="demo-typo-col3">\r\n<div class="demo-typo_padd">\r\n<p class="gklocation"><strong>location</strong> message <br /> <small>Use &lt;p class="gklocation"&gt;Txt...&lt;/p&gt;</small>.</p>\r\n<p class="gkmap"><strong>map</strong> message <br /> <small>Use &lt;p class="gkmap"&gt;Txt...!&lt;/p&gt;</small>.</p>\r\n<p class="gktag"><strong>tag</strong> message <br /> <small>Use &lt;p class="gktag"&gt;Txt...!&lt;/p&gt;</small>.</p>\r\n<p class="gkcomment"><strong>gkcomment</strong> message <br /> <small>Use &lt;p class="gkcomment"&gt;Txt...&lt;/p&gt;</small>.</p>\r\n<p class="gkbook"><strong>book</strong> message <br /> <small>Use &lt;p class="gkbook"&gt;Txt...&lt;/p&gt;</small>.</p>\r\n<p class="gkalarm"><strong>gkalarm</strong> message <br /> <small>Use &lt;p class="gkalarm"&gt;Txt...&lt;/p&gt;</small>.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class="demo-typoDiv typoDesc ">\r\n<h4 class="demo-typo">Highlights</h4>\r\n<div class="demo-typo-col2">\r\n<div class="demo-typo_padd">\r\n<p>This is a <spa