(4, 50, 'Module variations', 'module-variations', '<p>On this page you can see basic suffixes used in this template.</p>\r\n<p class="numblocks num-3"><span>01</span>For the modules used on the <strong>top1-2</strong> module positions we recommened to use only default module styles.</p>\r\n<p class="numblocks num-3"><span>02</span>The <strong>clear</strong> suffix is very useful to create banners or images without additional borders, margins and paddings. The clear suffix is also very useful inside the <strong>mainbody</strong>, <strong>mainbody_top</strong> and <strong>mainbody_bottom</strong> module positions.</p>\r\n<p class="numblocks num-3"><span>03</span>If you want to create a modules with big spaces and big centered title, please use the <strong>centered</strong> suffix.</p>\r\n<p class="numblocks num-3"><span>04</span>For NSP modules please always disable usage of the default CSS styles in the module settings.</p>', '', 0, 15, '2012-11-06 11:59:24', 572, '', '2013-03-04 13:37:38', 572, 0, '0000-00-00 00:00:00', '2012-11-06 11:59:24', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","info_block_position":"0","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"0","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 5, 4, '', '', 1, 31, '{"robots":"",