(19, 66, 'Frontpage elements', 'frontpage-elements', '<p>Frontpage can contain big header image if you add in the template settings (on the "Features" tab the <strong>imageBg</strong> page suffix.</p>\r\n\r\n<h3>Header form</h3>\r\n\r\n<p>Header form is based on the following code:</p>\r\n<pre>&lt;h1&gt;Start 30-Day free trial today. Set up in instant&lt;/h1&gt;\r\n&lt;h2&gt;Powerful landing page theme for running serious business&lt;/h2&gt;\r\n&lt;form class="gk-form"&gt;\r\n&lt;div&gt;&lt;input type="email" placeholder="Email address ..." /&gt; &lt;input type="submit" value="Get Started today!" /&gt;&lt;/div&gt;\r\n&lt;/form&gt;\r\n&lt;p&gt;&lt;a class="gk-video-link modal" href="http://www.youtube.com/embed/vb2eObvmvdI" rel="{handler: ''iframe'', size: {x: 560, y: 315}}"&gt;Watch the introduction&lt;/a&gt;&lt;/p&gt;</pre>\r\n\r\n<p>As you can see it uses <strong>h1</strong> and <strong>h2</strong> elements for creating headers, then the form is wrapped in the <strong>form</strong> element with <strong>gk-form</strong> class. The <strong>input</strong> elements are automatically styled inside the form. Additionally under the form there is the link with classes <strong>gk-video-link</strong> and <strong>modal</strong> - first class is responsible for the styling, second one is responsible for the popup - it uses the Joomla! built-in popup mechanism.</p>\r\n\r\n<p>In every module with <b>centered</b> suffix you can place a paragraph with <b>gkCentered</b> class.</p>\r\n\r\n<h3>Icons</h3>\r\n\r\n<p>Icons placed on the frontpage uses the following structure:</p>\r\n\r\n<pre>&lt;div class="gkIcons"&gt;\r\n&lt;div&gt;\r\n&lt;div class="gkIconArea"&gt;\r\n&lt;a href="#" class="gkCrop"&gt;Creative&lt;/a&gt;\r\n&lt;/div&gt;\r\n&lt;h2&gt;Creative&lt;/h2&gt;\r\n&lt;p&gt;Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vivamus eget elit eu velit vehicula feugiat. &lt;/p&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div&gt;\r\n&lt;div class="gkIconArea"&gt;\r\n&lt;a href="#" class="gkRocket"&gt;Rocket&lt;/a&gt;\r\n&lt;/div&gt;\r\n&lt;h2&gt;Powerful Control&lt;/h2&gt;\r\n&lt;p&gt;Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vivamus eget elit eu velit vehicula feugiat. &lt;/p&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div&gt;\r\n&lt;div class="gkIconArea"&gt;\r\n&lt;a href="#" class="gkMobile"&gt;Responsive&lt;/a&gt;\r\n&lt;/div&gt;\r\n&lt;h2&gt;Responsive Design&lt;/h2&gt;\r\n&lt;p&gt;Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vivamus eget elit eu velit vehicula feugiat. &lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;</pre>\r\n\r\n<p>Every column is placed in the <b>div</b> container which contains a container with class <b>gkIconArea</b> with link using one of these classes: <b>gkCrop</b>, <b>gkRocket</b> or <b>gkMobile</b>.</p>\r\n\r\n<p>Under the icon area you can place the <b>h2</b> element with title and paragraph with description</p>\r\n\r\n<h3>Sliding notebook</h3>\r\n\r\n<p>To create the two columns block with the sliding image you should use the following structure:</p>\r\n\r\n<pre>&lt;div class="gkHorizontalSlide"&gt;\r\n&lt;div class="gkHorizontalSlideLeftColumn"&gt;\r\n&lt;h2&gt;Joomla! and WordPress blog theme\r\ninspired by Metro Windows 8 UI&lt;/h2&gt;\r\n&lt;p&gt;Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vivamus eget elit eu velit vehicula feugiat. Integer viverra metus vitae lectus dictum eleifend. Lorem ipsum dolor sit amet. Donec viverra lobortis feugiat. Sed id odio ante.&lt;/p&gt;\r\n&lt;p&gt;Duis bibendum metus eu urna placerat mattis! Duis bibendum tempor massa at tristique. Integer viverr metus vitae lectus dictum eleifend amet.&lt;/p&gt;\r\n&lt;p&gt;&lt;a href="#" class="button"&gt;View Details&lt;/a&gt;&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;div class="gkHorizontalSlideRightColumn"&gt;\r\n&lt;img src="templates/gk_simplicity/images/demo/demo_notebook.png" alt="Notebook" /&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;</pre>\r\n\r\n<p>The most important part are the containers with classes: <b>gkHorizontalSlideLeftColumn</b> and <b>gkHorizontalSlideRightColumn</b> - in the second container there should be placed an image which will slide on scroll.</p>\r\n\r\n<h3>Sliding tablet</h3>\r\n\r\n<p>The sliding tablet effect is created using the following structure:</p>\r\n\r\n<pre>&lt;div class="gkTextBlock"&gt;\r\n&lt;h2&gt;We build responsive,&lt;br /&gt;mobile-friendly website&lt;/h2&gt;\r\n&lt;p&gt;Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nam scelerisque faucibus risus non iaculis. Fusce a augue ante, pellentesque pretium erat. Fusce in turpis in velit tempor pretium. Integer a leo libero.&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;img src="templates/gk_simplicity/images/demo/manufacturers.png" alt="Manufacturers" /&gt;\r\n\r\n&lt;img src="templates/gk_simplicity/images/demo/tablet_image.png" class="gkImageBlock" alt="Image block" /&gt;</pre>\r\n\r\n<p>The sliding image is placed in the <b>gkImageBlock</b> wrapper. The <b>gkTextBlock</b> class adds necessary top spacing for the text block.</p>\r\n\r\n<h3>Testimonials</h3>\r\n\r\n<p>The testimonials are created using the following structure:</p>\r\n\r\n<pre>&lt;div class="gkTestimonials"&gt;\r\n&lt;div&gt;\r\n&lt;figure&gt;\r\n&lt;img src="templates/gk_simplicity/images/demo/avatar-1.png" alt="Robert Gavick" /&gt;\r\n&lt;figcaption&gt;&lt;q&gt;Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nam scelerisque faucibus risus non iaculis. Fusce a augue ante, pellentesque.&lt;/q&gt;&lt;/figcaption&gt;\r\n&lt;/figure&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div&gt;\r\n&lt;figure&gt;\r\n&lt;img src="templates/gk_simplicity/images/demo/avatar-2.png" alt="Paulina Nowakowska" /&gt;\r\n&lt;figcaption&gt;&lt;q&gt;Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nam scelerisque faucibus risus non iaculis. Fusce a augue ante, pellentesque.&lt;/q&gt;&lt;/figcaption&gt;\r\n&lt;/figure&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div&gt;\r\n&lt;figure&gt;\r\n&lt;img src="templates/gk_simplicity/images/demo/avatar-3.png" alt="Tomasz Dziuda" /&gt;\r\n&lt;figcaption&gt;&lt;q&gt;Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nam scelerisque faucibus risus non iaculis. Fusce a augue ante, pellentesque.&lt;/q&gt;&lt;/figcaption&gt;\r\n&lt;/figure&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;</pre>\r\n\r\n<p>The testimonial content was wrapped up into the <b>figure</b> element - the image is used to create an avatar and the <b>figcaption</b> with the <b>blockquote</b> element is used to create the testimonial text.</p>\r\n\r\n<h3>Button area</h3>\r\n\r\n<p>The last custom HTML element from the frontpage uses the following structure:</p>\r\n\r\n<pre>&lt;div class="gkButtonArea"&gt;\r\n&lt;h3&gt;The 30 day free trial includes all features.&lt;small&gt;Your 30-day money back guarantee starts after your 30-day free trial.&lt;/small&gt;&lt;/h3&gt;\r\n&lt;a href="#"&gt;Get Started&lt;/a&gt;\r\n&lt;/div&gt;</pre>\r\n\r\n<p>Every link placed in the <b>gkButtonArea</b> element creates a big button floated to right.</p>', '', 0, 15, '2013-03-04 13:52:03', 572, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2013-03-04 13:52:03', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 1, 0, '', '', 1, 9, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
