(10030, 'gk_simplicity', 'template', 'gk_simplicity', '', 0, 1, 1, 0, '{"name":"gk_simplicity","type":"template","creationDate":"06 Mar 2013","author":"GavickPro","copyright":"Copyright (C) 2007 - 2013 GavickPro. All rights reserved.","authorEmail":"support@gavick.com","authorUrl":"http:\\/\\/gavick.com","version":"3.8","description":"\\n\\t\\t<link rel=\\"stylesheet\\" type=\\"text\\/css\\" href=\\"..\\/templates\\/gk_simplicity\\/admin\\/style.css\\" \\/>\\n\\t\\t\\t<style type=\\"text\\/css\\" media=\\"all\\">\\n\\t\\t\\t<!--\\n\\t\\t\\t#wrap1 {padding:0px 0px 4px 0px;}\\n\\t\\t\\t#wrap1 h1 {clear:both;font-family: Georgia, sans-serif;font-size:38px;margin:30px 20px 12px ;padding:0px 0px 24px 10px;color:#333; border-bottom: 1px solid #ccc; font-weight: normal;}\\n\\t\\t\\t#wrap1 h4 { border: none;  margin: 0 0 12px; padding:0; font: italic 20px\\/32px Georgia, sans-serif; color: #333; }\\n\\t\\t\\t#wrap1 sup { font-style: italic; font-size: }\\n\\t\\t\\t.wrap2 {background:#fff;padding: 20px; font-family: Arial; font-size:13px; text-align: justify; color: #4d4d4d; line-height: 24px;}\\n\\t\\t\\t#wrap1 .leftart {margin: 16px 0 0 176px; font-weight:normal!important; }\\n\\t\\t\\t#wrap1 .livedemo { margin-top: 28px; }\\n\\t\\t\\t-->\\n\\t\\t\\t<\\/style>\\t\\n\\t\\t\\t\\n\\t\\t\\t<div id=\\"wrap1\\">    \\n\\t\\t\\t<h1><em>Simplicity<\\/em><\\/h1>\\n\\t\\t\\t<div class=\\"wrap2\\">                    \\n\\t\\t\\t\\n\\t\\t\\t<a title=\\"Visit the official website!\\" href=\\"http:\\/\\/demo.gavick.com\\/joomla25\\/simplicity\\/\\" target=\\"_blank\\"> <img style=\\"padding-left: 10px;float: left; background-color: #fff;\\" src=\\"..\\/templates\\/gk_simplicity\\/images\\/template_image.jpg\\" border=\\"0\\" alt=\\"Logo\\" \\/><\\/a>       \\n\\t\\t\\t\\n\\t\\t\\t<div class=\\"leftart\\">            \\n\\t\\t\\t\\n\\t\\t\\t<h4>Joomla! Business \\/ Startup Template  <\\/h4>\\n\\t\\t\\t\\n\\t\\t\\t<p>\\tSimple doesn''t mean unsuccessful or unattractive...<br \\/>\\n\\t\\t\\tSimplicity is just the beginning... the beginning of astartup!<\\/p><p>\\n\\t\\t\\tIf you run a business and you want to enliven your online identity, Simplicity is the best choice you may make in order to create a successful and breathtaking website!<\\/p><p>\\n\\t\\t\\t\\n\\t\\t\\tThis business Joomla! template uses the latest trends available. You may make undoubtedly unique and attractive landing page of a product with Simplicity thanks to interesting animations of CSS3 use!<\\/p><p>\\n\\t\\t\\t\\n\\t\\t\\tThe content on your Joomla! website will be presented in a clear manner thanks to K2 and our powerful News Show Pro GK4.\\n\\t\\t\\t\\n\\t\\t\\tMoreover, catchy typography elements makes Simplicity more advanced and useful. If you use this business Joomla! template, you may be sure that you will achieve success in your business!<\\/p><p>\\n\\t\\t\\t\\n\\t\\t\\tFancy presenting your products on a website in an easy and attractive way? Simplicity is the solution... Take it now and create an outstanding Joomla! website immediately!  \\n\\t\\t\\t\\n\\t\\t\\t\\n\\t\\t\\t<\\/p>\\n\\t\\t\\t\\n\\t\\t\\t<p class=\\"livedemo\\">View Simplicity template in action <a href=\\"http:\\/\\/demo.gavick.com\\/joomla25\\/simplicity\\/\\" target=\\"_blank\\">here<\\/a>...<\\/p><small>Gavern v.3.8<\\/small><\\/div>\\n\\t\\t\\t<\\/div> \\n\\t\\t\\t<\\/div>\\n\\t","group":""}', '{"template_color":"1","default_layout":"default","layout_position":"left","template_width":"1230","tablet_width":"1024","tablet_small_width":"820","mobile_width":"580","sidebar_position":"right","sidebar_width":"30","rwd":"1","logo_type":"image","logo_image":"","logo_text":"","logo_slogan":"","print_logo":"","print_behaviour":"1","favicon_image":"","stylearea":"1","framework_logo":"1","webmaster_contact_type":"1","webmaster_contact":"webmaster@gavick.com","typography":"0","typo_iconset":"0","tools":"1","show_menu":"1","startlevel":"0","endlevel":"-1","menu_animation":"slide","menu_height":"0","menu_width