(66, 'index.php?option=com_k2&view=item&id=66', 'index.php?option=com_k2&view=item&id=66:natyazhnoi-potolok-v-novoi-kvartire&Itemid=113', 'Стоит ли устанавливать натяжной потолок в новой квартире', 'Стоит ли устанавливать натяжной потолок в новой квартире? Потолок в любой комнате - ответственная часть всего интерьера. Он находится на самом видном месте. Всегда хочется, чтобы он был ровным и гладким, чтобы с него не сыпалось и не капало. Обычный ремон', '2014-04-23 11:59:01', '2f75d48fdd7e8978a1e8bdb12b557712', 1, 1, 1, '*', '2012-11-06 12:40:30', '0000-00-00 00:00:00', '2014-04-23 07:27:11', '0000-00-00 00:00:00', 0, 0, 1, );
