(55, 'Светильники для натяжных потолков', 'svetilniki-dlya-natyazhnykh-potolkov', 1, 1, '<p>Итак, вы решили оснастить <em>натяжными потолками</em> ваш дом. Таким образом, вы должны обязательно задать себе вопрос, какие виды светильников возможны для установки на натяжной потолок, и какова мощность лампочек, используемых для таких источников света до их покупки.</p>\r\n', '\r\n<p>Высокая температура не изменяет внешне<strong> натяжные потолки</strong>, это говорит о том, что можно особо не беспокоится о покупаемом вами светильнике. Вряд ли он окажется неподходящим. Но нужно заметить, что температура должна быть ниже или равна 60 градусам.</p>\r\n<p>Это указывает на то, что лампы накаливания должны быть мощностью в 60 Ватт и не больше. Галогеновые лампы – 35 Ватт. Лампочки накаливания в люстрах обязаны находится от потолка в 15 сантиметрах.</p>\r\n<pre>Производители предлагают множество светильников, основное предназначение которых – установка на натяжные потолки. От других типов освещения их отличает специальный материал, который почти не способен проводить тепло. Поэтому можете  особо не беспокоиться по поводу покупки ламп.</pre>\r\n<p>Но нужно учесть, что установка необходимого оснащения для крепежа люстр производится до установки потолков. А значит, вам заранее нужно определится с освещением, обращая внимания на все ограничения, что были описаны выше.</p>', NULL, NULL, '[{"id":"1","value":""},{"id":"2","value":""},{"id":"3","value":""}]', '   ', '2013-03-04 12:46:53', 572, '', 0, '0000-00-00 00:00:00', '2014-03-07 07:24:30', 902, '2012-11-06 12:44:09', '0000-00-00 00:00:00', 0, 1, 7, 0, 0, 'Светильники для натяжных потолков', '', '', '', 119, '{"catItemTitle":"","catItemTitleLinked":"","catItemFeaturedNotice":"","catItemAuthor":"","catItemDateCreated":"","catItemRating":"","catItemImage":"","catItemIntroText":"","catItemExtraFields":"","catItemHits":"","catItemCategory":"","catItemTags":"","catItemAttachments":"","catItemAttachmentsCounter":"","catItemVideo":"","catItemVideoWidth":"","catItemVideoHeight":"","catItemAudioWidth":"","catItemAudioHeight":"","catItemVideoAutoPlay":"","catItemImageGallery":"","catItemDateModified":"","catItemReadMore":"","catItemCommentsAnchor":"","catItemK2Plugins":"","itemDateCreated":"","itemTitle":"","itemFeaturedNotice":"","itemAuthor":"","itemFontResizer":"","itemPrintButton":"","itemEmailButton":"","itemSocialButton":"","itemVideoAnchor":"","itemImageGalleryAnchor":"","itemCommentsAnchor":"","itemRating":"","itemImage":"","itemImgSize":"","itemImageMainCaption":"","itemImageMainCredits":"","itemIntroText":"","itemFullText":"","itemExtraFields":"","itemDateModified":"","itemHits":"","itemCategory":"","itemTags":"","itemAttachments":"","itemAttachmentsCounter":"","itemVideo":"","itemVideoWidth":"","itemVideoHeight":"","itemAudioWidth":"","itemAudioHeight":"","itemVideoAutoPlay":"","itemVideoCaption":"","itemVideoCredits":"","itemImageGallery":"","itemNavigation":"","itemComments":"","itemTwitterButton":"","itemFacebookButton":"","itemGooglePlusOneButton":"","itemAuthorBlock":"","itemAuthorImage":"","itemAuthorDescription":"","itemAuthorURL":"","itemAuthorEmail":"","itemAuthorLatest":"","itemAuthorLatestLimit":"","itemRelated":"","itemRelatedLimit":"","itemRelatedTitle":"","itemRelatedCategory":"","itemRelatedImageSize":"","itemRelatedIntrotext":"","itemRelatedFulltext":"","itemRelatedAuthor":"","itemRelatedMedia":"","itemRelatedImageGallery":"","itemK2Plugins":""}', '', 'robots=\nauthor=', '', '', '*'),
(56, 'Натяжные потолки - влагостойкие', 'natyazhnye-potolki-vlagostojkie', 1, 1, '<p>Никому не известно, когда жизнь преподнесет очередной подарок, который может оказаться весьма неприятным. Например, потоп, благодаря соседу сверху, который сделает потраченные деньги и усилия на ремонт напрасными.</p>\r\n<p><strong>Натяжные потолки</strong> – достаточно прочный материал, который выдерживает вес до 100 кг. Вода, что находится над полотном, будет создавать давление, тем самым искать щелочку, чтобы вытечь наружу. Одна из таких щелочек может быть пространством, которое находится вокруг люстры. Очень важно обесточить электричество, ввиду того, что может произойти короткое замыкание, что приведет к пожару.</p>\r\n', '\r\n<p>Следующий этап - удаление воды скопившейся над натяжным потолком. Делать это самостоятельно, крайне не рекомендуется, если количество воды достаточно большое. Для этого необходимо вызвать мастеров, у которых есть опыт работы с натяжными потолками в такой ситуации.</p>\r\n<p>Слив воды – это частичный или полный демонтаж натяжного потолка. Полотно тщательно сушится, его подвергают дезинфекции, которая может образоваться из-за влаги. После всех операций высушивания и дезинфекции полотно обратно устанавливается на место. Есть случаи, где демонтаж и вовсе не требуется, натяжной потолок можно избавить от влаги при помощи отверстий, расположенных в люстре.</p>\r\n<p>Слив воды – это частичный или полный демонтаж натяжного потолка. Полотно тщательно сушится, его подвергают дезинфекции, которая может образоваться из-за влаги. После всех операций высушивания и дезинфекции полотно обратно устанавливается на место. Есть случаи, где демонтаж и вовсе не требуется, натяжной потолок можно избавить от влаги при помощи отверстий, расположенных в люстре.</p>\r\n<p><em>Натяжной потолок – очень полезная конструкция, которая удерживает напор воды.</em> Полотно может сберечь всю комнату: диван, телевизор, компьютер, кровать, стулья и прочую мебель, и атрибуты современной жизни. Решение о том, как будет, происходить слив воды с натяжного потолка должны принимать специалисты.</p>', NULL, NULL, '[{"id":"1","value":""},{"id":"2","value":""},{"id":"3","value":""}]', '   ', '2013-03-04 12:48:42', 572, '', 0, '0000-00-00 00:00:00', '2014-04-23 08:59:28', 902, '2012-11-06 12:42:22', '0000-00-00 00:00:00', 0, 1, 8, 0, 1, 'Влагостойкие натяжные потолки', '', '', '', 120, '{"catItemTitle":"","catItemTitleLinked":"","catItemFeaturedNotice":"","catItemAuthor":"","catItemDateCreated":"","catItemRating":"","catItemImage":"","catItemIntroText":"","catItemExtraFields":"","catItemHits":"","catItemCategory":"","catItemTags":"","catItemAttachments":"","catItemAttachmentsCounter":"","catItemVideo":"","catItemVideoWidth":"","catItemVideoHeight":"","catItemAudioWidth":"","catItemAudioHeight":"","catItemVideoAutoPlay":"","catItemImageGallery":"","catItemDateModified":"","catItemReadMore":"","catItemCommentsAnchor":"","catItemK2Plugins":"","itemDateCreated":"","itemTitle":"","itemFeaturedNotice":"","itemAuthor":"","itemFontResizer":"","itemPrintButton":"","itemEmailButton":"","itemSocialButton":"","itemVideoAnchor":"","itemImageGalleryAnchor":"","itemCommentsAnchor":"","itemRating":"","itemImage":"","itemImgSize":"","itemImageMainCaption":"","itemImageMainCredits":"","itemIntroText":"","itemFullText":"","itemExtraFields":"","itemDateModified":"","itemHits":"","itemCategory":"","itemTags":"","itemAttachments":"","itemAttachmentsCounter":"","itemVideo":"","itemVideoWidth":"","itemVideoHeight":"","itemAudioWidth":"","itemAudioHeight":"","itemVideoAutoPlay":"","itemVideoCaption":"","itemVideoCredits":"","itemImageGallery":"","itemNavigation":"","itemComments":"","itemTwitterButton":"","itemFacebookButton":"","itemGooglePlusOneButton":"","itemAuthorBlock":"","itemAuthorImage":"","itemAuthorDescription":"","itemAuthorURL":"","itemAuthorEmail":"","itemAuthorLatest":"","itemAuthorLatestLimit":"","itemRelated":"","itemRelatedLimit":"","itemRelatedTitle":"","itemRelatedCategory":"","itemRelatedImageSize":"","itemRelatedIntrotext":"","itemRelatedFulltext":"","itemRelatedAuthor":"","itemRelatedMedia":"","itemRelatedImageGallery":"","itemK2Plugins":""}', '', 'robots=\nauthor=', '', '', '*'),
(57, 'Натяжные потолки - низкие цены', 'natyazhnye-potolki-nizkie-tseny', 1, 1, '<p>Сейчас существует большое разнообразие материалов, из которых делаются потолки. Особой популярностью пользуются натяжные потолки. Но чтобы в будущем избежать многих неприятностей, особое внимание уделите материалу, из которого сделано полотно. Тканевый не очень надежный вариант, так как при малейшей протечке он не будет сдерживать воду, и на нем будут образовываться разводы. А вот потолки из ПВХ или полиэстера. Отлично удерживают влагу, до ста литров на один метр квадратный. Так же они имеют большое разнообразие цветов и фактур, в отличие от тканевого материала.</p>\r\n', '\r\n<p>При использовании натяжных потолков вы получаете идеально ровную поверхность. Так что он хорошо подойдет для тех, у кого основной потолок неровный. Установка такого потолка в одной комнате занимает около 2 часов. При установке натяжного потолка количество мусора и грязи минимальное.</p>\r\n<p>Натяжной потолок можно устанавливать разных цветовых гамм. Тое есть в одной комнате потолок может быть разноцветный. У натяжных потолков разная фактура: глянцевая, матовая, сатиновая.</p>\r\n<pre>Матовые потолки обычно ставятся в спальнях, чтобы не было бликов. Глянцевые потолки обычно натягиваются в зале, там, где происходит скопления народа. Они предают глубину. Несмотря на тонкую толщину полотна, натяжные потолки очень прочные.</pre>\r\n<p>Потолки бояться острых предметов и химических веществ. Натяжные потолки долговечны, компании дают на них гарантии от 3 до 10 лет.</p>\r\n<p><strong>Натяжные потолки от Фолиан Строй - это лучший вариант для вашего дома.</strong></p>', NULL, NULL, '[{"id":"1","value":""},{"id":"2","value":""},{"id":"3","value":""}]', '   ', '2013-03-04 12:48:56', 572, '', 0, '0000-00-00 00:00:00', '2014-06-27 07:56:27', 902, '2012-11-06 12:40:30', '0000-00-00 00:00:00', 0, 1, 1, 0, 2, 'Низкие цены на натяжные потолки', '', '', '', 154, '{"catItemTitle":"","catItemTitleLinked":"","catItemFeaturedNotic