(66, 'Стоит ли устанавливать натяжной потолок в новой квартире', 'natyazhnoi-potolok-v-novoi-kvartire', 1, 1, '<p>Стоит ли устанавливать <strong>натяжной потолок</strong> в новой квартире? Потолок в любой комнате - ответственная часть всего интерьера. Он находится на самом видном месте. Всегда хочется, чтобы он был ровным и гладким, чтобы с него не сыпалось и не капало. Обычный ремонт потолка состоит из оштукатуривания, выравнивания, что достаточно сложно. Возможна последующая окраска или оклеивание обоями.</p>\r\n', '\r\n<p>Натяжной потолок – это что-то новое и загадочное и кажется, дорогим, сложным и недоступным. Натяжные потолки появились относительно недавно в нашей стране и уже получили большую популярность. В настоящее время они производятся во многих странах, имеют множество разновидностей. Их стали применять не только, как экслюзив, но и как обычное дизайнерское решение, в разных помещениях - офисных и жилых помещениях. Все больше используют натяжные потолки в дизайнах обычных квартир. Натяжные потолки изготовляются, в основном, из экологически чистых материалов, обладающих необычайной гибкостью, легкостью и невесомостью. <strong>Полотна натяжных потолков</strong> отличаются долговечностью и надежностью, не теряют цвет достаточно долго. Это позволяет любое дизайнерское решение воплотить в реальную действительность. Конструкция натяжного потолка воспринимается, как невесомая. Но такие потолки все-таки практичные и достаточно прочные. Натяжные потолки отнимают незначительное расстояние между основным потолком и натяжным, около 4 сантиметров.</p>\r\n<pre>Натяжные потолки можно устанавливать в помещениях, которые отличаются повышенной влажностью - это ванная, кухня. На полотне натяжного потолка не образуется конденсат, а если появляется загрязненность, то она легко может быть удалена моющими средствами. Натяжные потолки имеют среднюю гарантию – 10 лет. </pre>\r\n<p>Достоинство натяжного потолка также - несложный и быстрый монтаж. После монтажа все вокруг остается чистым - нет мусора и пыли. Установка занимает 1-2 дня. Кроме того, потолки можно поменять и изменить интерьер. Можно сделать потолок «бархатным», «шелковым», мерцающим и т.д. Стоимость стандартного потолка с установкой – от 25 долларов за 1 квадратный метр.</p>\r\n<p>Все эти достоинства делают натяжные потолки очень привлекательными для широкого круга собственников новых квартир.</p>\r\n<p><strong>Фолиан Строй изготавливает и устанавливает качественные натяжные потолки!</strong></p>', NULL, NULL, '[{"id":"1","value":""},{"id":"2","value":""},{"id":"3","value":""}]', '   ', '2014-04-23 07:27:11', 572, '', 0, '0000-00-00 00:00:00', '2014-04-23 08:59:01', 902, '2012-11-06 12:40:30', '0000-00-00 00:00:00', 0, 1, 2, 0, 2, 'Натяжной потолок в новой квартире', 'Фолиан Строй', '', '', 163, '{"catItemTitle":"","catItemTitleLinked":"","catItemFeaturedNotice":"","catItemAuthor":"","catItemDateCreated":"","catItemRating":"","catItemImage":"","catItemIntroText":"","catItemExtraFields":"","catItemHits":"","catItemCategory":"","catItemTags":"","catItemAttachments":"","catItemAttachmentsCounter":"","catItemVideo":"","catItemVideoWidth":"","catItemVideoHeight":"","catItemAudioWidth":"","catItemAudioHeight":"","catItemVideoAutoPlay":"","catItemImageGallery":"","catItemDateModified":"","catItemReadMore":"","catItemCommentsAnchor":"","catItemK2Plugins":"","itemDateCreated":"","itemTitle":"","itemFeaturedNotice":"","itemAuthor":"","itemFontResizer":"","itemPrintButton":"","itemEmailButton":"","itemSocialButton":"","itemVideoAnchor":"","itemImageGalleryAnchor":"","itemCommentsAnchor":"","itemRating":"","itemImage":"","itemImgSize":"","itemImageMainCaption":"","itemImageMainCredits":"","itemIntroText":"","itemFullText":"","itemExtraFields":"","itemDateModified":"","itemHits":"","itemCategory":"","itemTags":"","itemAttachments":"","itemAttachmentsCounter":"","itemVideo":"","itemVideoWidth":"","itemVideoHeight":"","itemAudioWidth":"","itemAudioHeight":"","itemVideoAutoPlay":"","itemVideoCaption":"","itemVideoCredits":"","itemImageGallery":"","itemNavigation":"","itemComments":"","itemTwitterButton":"","itemFacebookButton":"","itemGooglePlusOneButton":"","itemAuthorBlock":"","itemAuthorImage":"","itemAuthorDescription":"","itemAuthorURL":"","itemAuthorEmail":"","itemAuthorLatest":"","itemAuthorLatestLimit":"","itemRelated":"","itemRelatedLimit":"","itemRelatedTitle":"","itemRelatedCategory":"","itemRelatedImageSize":"","itemRelatedIntrotext":"","itemRelatedFulltext":"","itemRelatedAuthor":"","itemRelatedMedia":"","itemRelatedImageGallery":"","itemK2Plugins":""}', 'Установка натяжного потолка в новой квартире', 'robots=\nauthor=', 'натяжной потолок, установка натяжного потолка, полотно натяжного потолка, ремонт в квартире', '', '*'),
(67, 'Плюсы и минусы натяжных потолков', 'plusi-i-minusi-natyazhnih-potolkov', 1, 1, '<p>На сайтах продавцов натяжных потолков информация о них, естественно, отфильтрована в сторону позитива: преимущества превозносятся, а недостатки скромно умалчиваются. Мы не будем умалять достоинства натяжных потолков – их красоту, как минимум, не оспоришь, но попробуем более объективно посмотреть как на плюсы, так и на минусы этого вида отделки.</p>\r\n', '\r\n<p>Начнем с достоинств.</p>\r\n<p>Первое из них – очень эстетичная «внешность». Большой выбор цветов, идеально гладкая поверхность, возможность создавать различные многоуровневые конструкции, комбинировать цвета, текстуру, освещение. Красивые глянцевые полотна, близкие по отражающим свойствам к зеркалам, способны сделать интерьер праздничным, а при правильно подобранном оттенке – и значительно расширить его визуальные границы.</p>\r\n<p>Но при всем этом, есть и немного неприятные нюансы. ПВХ-полотна для потолка «сшиваются», поэтому безукоризненно гладкая поверхность есть только между швами, а сами швы достаточно заметны при любом освещении. Эта проблема отсутствует у тканевых натяжных потолков, которые выпускаются в рулонах шириной 4 м, поэтому могут охватывать всю комнату или имеют значительно меньше швов. Но у них не такой большой выбор вариантов окраски и только одна фактура – матовая.</p>\r\n<pre>Обромный и неоспоримый плюс – гибкость в создании формы потолка. С помощью каркасов натяжные потолки можно устанавливать под разными углами, делать много уровней разных форм, однако каждая «изюминка» сразу отражается в цене. </pre>\r\n<p>Водостойкость. Действительно, натяжные потолки способны уберечь квартиру от затопления. Это касается только ПВХ-потолотен и их характеристики впечатляющие: каждый квадратный метр такого потолка способен удержать больше 100 литров воды. Причем растяжение самой пленки обратимо – после того, как мастер правильно откачает воду, потолок возвращается к прежнему виду. При больших протечках это несомненный плюс, а вот если авария у соседей сверху была небольшая, то, к примеру, потолок из пластиковых панелей в ванной в этом случае бы просто высох без последствий, а в случае с натяжным потолком придется или тратиться на вызов мастера, или оставить до высыхания, рискуя завести в межпотолочном пространстве плесень, так как он достаточно герметичен и сохнуть будет долго.</p>\r\n<p>Чистая технология монтажа. Здесь правильнее будет сказать «чище, чем другие». Действительно, по сравнению со штукатуркой или гипсокартонном, пыли и мусора будет меньше, однако он все же будет от сверления отверстий под дюбеля, от хождения мастеров. Поэтому не стоит думать, что натяжной потолок просто «возникнет» сам по себе, не оставив никаких следов от установки.</p>\r\n<p>Натяжной потолок скрывает дефекты перекрытия, не требует базовой обработки поверхности и не имеет проблемы растрескивания или деформации в новых домах. К первым двум пунктам возражений нет, а вот в новых домах может возникнуть другая проблема – если из-за усадки дома нарушится герметичность межпотолочного пространства на полотном, то оно сквозняком может «притянуться» вверх. Нужно будет опять вызывать мастера, переустанавливать и тщательно герметизировать каркас и стыки возле вентиляционных отверстий.</p>\r\n<p>Есть и другие маленькие нюансы: ПВХ-пленки при отрицательных температурах теряют эластичность, становятся жесткими и хрупкими, поэтому в неотапливаемой мансарде, на веранде или в лоджии с ними могут возникнуть проблемы. При высоких температурах (больше 60 С) они плавятся, поэтому не любой светильник подойдет для натяжного потолка.</p>\r\n<p>Описывая преимущества, мы коснулись и относительных недостатков, но у натяжных потолков есть и абсолютный недостаток – они могут разорваться от неосторожного прикосновения острым предметом, от удара или нажатия при уборке.</p>\r\n<p>Есть и другие маленькие нюансы: ПВХ-пленки при отрицательных температурах теряют эластичность, становятся жесткими и хрупкими, поэтому в неотапливаемой мансарде, на веранде или в лоджии с ними могут возникнуть проблемы. При высоких температурах (больше 60 С) они плавятся, поэтому не любой светильник подойдет для натяжного потолка.</p>\r\n<p>Тем не менее, хотя многие из разрекламированных свойств натяжных потолков являются преувеличенными, они остаются на сегодняшний день самым красивым вариантом из тех, которые доступны широкому кругу потребителей. Поэтому им прощают «недостатки», тем более, что не существует идеального материала, который бы ими не обладал.</p>\r\n<p><strong>Заказывая натяжной потолок в компании Фолиан Строй Вы можете быть уверены в том, что он будет обладать всеми известными достоинствами!</strong></p>', NULL, NULL, '[{"id":"1","value":""},{"id":"2","value":""},{"id":"3","value":""}]', '   ', '2014-04-23 07:47:59', 572, '', 0, '0000-00-00 00:00:00', '2014-04-23 08:58:17', 902, '2012-11-06 12:40:30', '0000-00-00 00:00:00', 0, 1, 3, 0, 2, 'Достоинства натяжных потолков', 'Фолиан Строй', '', '', 261, '{"catItemTitle":"","catItemTitleLinked":"","catItemFeaturedNotice":"","catItemAuthor":"","catItemDateCreated":"","catItemRating":"","catItemImage":"","catItemIntroText":"","catItemExtraFields":"","catItemHits":"","catItemCategory":"","catItemTags":"","catItemAttachments":"","catItemAttachmentsCounter":"","catItemVideo":"","catItemVideoWidth":"","catItemVideoHeight":"","catItemAudioWidth":"","catItemAudioHeight":"","catItemVideoAutoPlay":"","catItemImageGallery":"","catItemDateModified":"","catItemReadMore":"","catItemCommentsAnchor":"","catItemK2Plugins":"","itemDateCreated":"","itemTitle":"","itemFeaturedNotice":"","itemAuthor":"","itemFontResizer":"","itemPrintButton":"","itemEmailButton":"","itemSocialButton":"","itemVideoAnchor":"","itemImageGalleryAnchor":"","itemCommentsAnchor":"","itemRating":"","itemImage":"","itemImgSize":"","itemImageMainCaption":"","itemImageMainCredits":"","itemIntroText":"","itemFullText":"","itemExtraFields":"","itemDateModified":"","itemHits":"","itemCategory":"","itemTags":"","itemAttachments":"","itemAttachmentsCounter":"","itemVideo":"","itemVideoWidth":"","itemVideoHeight":"","itemAudioWidth":"","itemAudioHeight":"","itemVideoAutoPlay":"","itemVideoCaption":"","itemVideoCredits":"","itemImageGallery":"","itemNavigation":"","itemComments":"","itemTwitterButton":"","itemFacebookButton":"","itemGooglePlusOneButton":"","itemAuthorBlock":"","itemAuthorImage":"","itemAuthorDescription":"","itemAuthorURL":"","itemAuthorEmail":"","itemAuthorLatest":"","itemAuthorLatestLimit":"","itemRelated":"","itemRelatedLimit":"","itemRelatedTitle":"","itemRelatedCategory":"","itemRelatedImageSize":"","itemRelatedIntrotext":"","itemRelatedFulltext":"","itemRelatedAuthor":"","itemRelatedMedia":"","itemRelatedImageGallery":"","itemK2Plugins":""}', 'Достоинства и недостатки натяжных потолков', 'robots=\nauthor=', 'достоинства натяжных потолков, недостатки натяжных потолков', '', '*'),
(68, 'Как красиво сделать потолок', 'kak-krasivo-sdelat-potolok', 1, 1, '<p>При проведении в своем доме ремонта, любой его хозяин продумывает и учитывает все мелочи. Ведь именно благодаря этому можно добиться в своем доме желаемого уюта и комфорта. Но если имеющиеся на стенах незначительные неровности и дефекты можно достаточно легко скрыть, то любые неровности на потолке тут же бросаются в глаза, тем самым портя всю красоту. Именно поэтому, хочется порекомендовать несколько советов, которые позволят придать Вашему потолку красоты.</p>\r\n', '\r\n<p>Инструкция:</p>\r\n<p>1. Первым делом необходимо удалить, воспользовавшись помощью наждачной бумаги следы от старой побелки. После того, как побелка будет полностью удалена, можно начинать поверхность оштукатуривать. При этом следует произвести выравнивание перепадов плит перекрытия по высоте, заделать имеющиеся швы или щели. Теперь можно приступать к шпаклеванию потолка.</p>\r\n<p>2. Теперь можно начинать производить монтаж, предварительно при этом выбрав пришедшийся по вкусу материал. Изготавливаются натяжные потолки из поливиниловой пленки, которая в свою очередь натягивается на специально изготовленный из пластика каркас. Смотрятся потолки такого типа достаточно красиво. Помимо этого, они обладают разнообразной фактурой, являются влагостойкими и долговечными. Изготавливаться натяжной потолок может глянцевым или матовым, способен обеспечивать определенные эффекты, копировать фактуру мрамора или замши. Что немаловажно, данный тип потолков достаточно легко моется, а монтируют их в основном в детских комнатах, спальнях или гостиных.</p>\r\n<pre>Компания Фолиан Строй предлагает огромный выбор цветов и фактур натяжных потолков. Наши мастера помогут Вам воплотить в жизнь самые смелые дизайнерские решения и придать потолкам в Вашей квартире эфектный и законченный вид.</pre>\r\n<p>3. Особую изысканность и неповторимость смогут придать потолки в Вашем доме, изготовленные из лепнины. Самым простым вариантом является приобретение уже готовой лепнины, которая в свою очередь подразделяется на гипсовую и пластиковую. Но имеется тут и третий вариант, а именно, изготовление потолка специалистами по Вашему индивидуальному заказу. Если произвести правильное размещение лепнины, то она позволит скрыть на потолке даже мелкие имеющиеся дефекты. В основном ее применяют в гостиных и спальнях.</p>\r\n<p>4. Плитку для потолка применяют в детских, кабинетах или спальнях. Если плитка обладает специальной защитной пленкой, то можно ее применять также и на кухне. Что немаловажно, ею можно создавать, благодаря разнообразию цветовых решений имитацию рогожки, лепнины и резьбы.</p>\r\n<p>5. Кроме этого, на потолке будут красиво смотреться панели, исполнение которых может быть поливинилхлоридным или алюминиевым. Первые применяют в туалетах, кухнях и ваннах. А вторые в кухнях и прихожих. Потолочные панели замечательно сочетаются со светильниками галогенного типа.</p>\r\n<p>Звоните и заказывайте натяжной потолок у Фолиан Строй! Квалифицированный менеджер произведет замеры и предложит варианты дизайна и материалов в день заказа.</p>', NULL, NULL, '[{"id":"1","value":""},{"id":"2","value":""},{"id":"3","value":""}]', '   ', '2014-04-23 07:57:52', 572, '', 0, '0000-00-00 00:00:00', '2014-04-23 08:57:19', 902, '2012-11-06 12:40:30', '0000-00-00 00:00:00', 0, 1, 4, 0, 2, 'Красивый натяжной потолок', 'Фолиан Строй', '', '', 272, '{"catItemTitle":"","catItemTitleLinked":"","catItemFeaturedNotice":"","catItemAuthor":"","catItemDateCreated":"","catItemRating":"","catItemImage":"","catItemIntroText":"","catItemExtraFields":"","catItemHits":"","catItemCategory":"","catItemTags":"","catItemAttachments":"","catItemAttachmentsCounter":"","catItemVideo":"","catItemVideoWidth":"","catItemVideoHeight":"","catItemAudioWidth":"","catItemAudioHeight":"","catItemVideoAutoPlay":"","catItemImageGallery":"","catItemDateModified":"","catItemReadMore":"","catItemCommentsAnchor":"","catItemK2Plugins":"","itemDateCreated":"","itemTitle":"","itemFeaturedNotice":"","itemAuthor":"","itemFontResizer":"","itemPrintButton":"","itemEmailButton":"","itemSocialButton":"","itemVideoAnchor":"","itemImageGalleryAnchor":"","itemCommentsAnchor":"","itemRating":"","itemImage":"","itemImgSize":"","itemImageMainCaption":"","itemImageMainCredits":"","itemIntroText":"","itemFullText":"","itemExtraFields":"","itemDateModified":"","itemHits":"","itemCategory":"","itemTags":"","itemAttachments":"","itemAttachmentsCounter":"","itemVideo":"","itemVideoWidth":"","itemVideoHeight":"","itemAudioWidth":"","itemAudioHeight":"","itemVideoAutoPlay":"","itemVideoCaption":"","itemVideoCredits":"","itemImageGallery":"","itemNavigation":"","itemComments":"","itemTwitterButton":"","itemFacebookButton":"","itemGooglePlusOneButton":"","itemAuthorBlock":"","itemAuthorImage":"","itemAuthorDescription":"","itemAuthorURL":"","itemAuthorEmail":"","itemAuthorLatest":"","itemAuthorLatestLimit":"","itemRelated":"","itemRelatedLimit":"","itemRelatedTitle":"","itemRelatedCategory":"","itemRelatedImageSize":"","itemRelatedIntrotext":"","itemRelatedFulltext":"","itemRelatedAuthor":"","itemRelatedMedia":"","itemRelatedImageGallery":"","itemK2Plugins":""}', 'Красивый натяжной потолк', 'robots=\nauthor=', 'красивые натяжные потолки, советы по ремонту потолка', '', '*'),
(69, 'Преимущества натяжных потолков', 'preimushestva-natyazhnih-potolkov', 1, 1, '<p>Часто при ремонте квартиры не обращают внимания на потолок. Даже очень красивая зарубежная фурнитура, идеально уложенный паркет,даже самые дорогие обои или шторы не могут придать дому атмосферу уютности, благополучия и теплоты, если потолок будет просто в побелке. К счастью,высокие технологии внедряются во все области, и стоительство не является исключением. Здесь было сделано одно очень значимое изобретение-натяжные потолки. Оно уникально, учитывая формы и цвета, которые можно придать своему потолку. Натяжной потолок-это декоративное полотно,которое крепится на железных или пластмассовых креплениях к основному потолку. Сейчас натяжным потолкам отдается преимущество. И не зря. Целый ряд премуществ, таких как: простота монтажа, дизайн, формы и другие отличают натяжные потолки от всех других способов отделки потолка.</p>\r\n', '\r\n<p>Итак, давайте перечислим преимущества натяжных потолков:</p>\r\n<p>1. Быстрота монтажа – в закрытом помещении можно свободно установить натяжной потолок за 2-3 часа.</p>\r\n<p>2. Легкость демонтажа – в случае демонтажа верно обратное,а именно:как быстро потолок устанавливается, быстро потолок снимается.Причем если постараться, возможно применение полотна повторно.</p>\r\n<pre>Компания Фолиан Строй предлагает огромный выбор цветов и фактур натяжных потолков. Наши мастера помогут Вам воплотить в жизнь самые смелые дизайнерские решения и придать потолкам в Вашей квартире эфектный и законченный вид.</pre>\r\n<p>3. Разнообразие и богатство дизайна – ввиду гибкости полотна, возможна любая, даже самая пикантная идея формы потолка. Заводы производят полотна разной фактуры, абсолютно любого цвета, что предоставляет огромный простор для дизайнерских идей.</p>\r\n<p>4. Экологичность – материал экологичен, не впитывает запахи.</p>\r\n<p>5. Технологичность – натяжные потолки очень удобны и в строительном плане. В них можно спрятать торчащие провода, которые не нужно выставлять напоказ. Причем для этого не потребуется сверлить дырки в стенах,чтобы провести их, как делалось раньше.также можно под натяжной потолок поместить сигнализацию.</p>\r\n<p>6. Простота ухода – максимум, что нужно за уходом натяжного потолка - это уборка сухой тряпкой один раз в неделю или даже реже.</p>', NULL, NULL, '[{"id":"1","value":""},{"id":"2","value":""},{"id":"3","value":""}]', '   ', '2014-04-23 08:12:06', 572, '', 0, '0000-00-00 00:00:00', '2014-04-23 08:56:47', 902, '2012-11-06 12:40:30', '0000-00-00 00:00:00', 0, 1, 5, 0, 2, 'Преимущества натяжных потолков', 'Фолиан Строй', '', '', 226, '{"catItemTitle":"","catItemTitleLinked":"","catItemFeaturedNotice":"","catItemAuthor":"","catItemDateCreated":"","catItemRating":"","catItemImage":"","catItemIntroText":"","catItemExtraFields":"","catItemHits":"","catItemCategory":"","catItemTags":"","catItemAttachments":"","catItemAttachmentsCounter":"","catItemVideo":"","catItemVideoWidth":"","catItemVideoHeight":"","catItemAudioWidth":"","catItemAudioHeight":"","catItemVideoAutoPlay":"","catItemImageGallery":"","catItemDateModified":"","catItemReadMore":"","catItemCommentsAnchor":"","catItemK2Plugins":"","itemDateCreated":"","itemTitle":"","itemFeaturedNotice":"","itemAuthor":"","itemFontResizer":"","itemPrintButton":"","itemEmailButton":"","itemSocialButton":"","itemVideoAnchor":"","itemImageGalleryAnchor":"","itemCommentsAnchor":"","itemRating":"","itemImage":"","itemImgSize":"","itemImageMainCaption":"","itemImageMainCredits":"","itemIntroText":"","itemFullText":"","itemExtraFields":"","itemDateModified":"","itemHits":"","itemCategory":"","itemTags":"","itemAttachments":"","itemAttachmentsCounter":"","itemVideo":"","itemVideoWidth":"","itemVideoHeight":"","itemAudioWidth":"","itemAudioHeight":"","itemVideoAutoPlay":"","itemVideoCaption":"","itemVideoCredits":"","itemImageGallery":"","itemNavigation":"","itemComments":"","itemTwitterButton":"","itemFacebookButton":"","itemGooglePlusOneButton":"","itemAuthorBlock":"","itemAuthorImage":"","itemAuthorDescription":"","itemAuthorURL":"","itemAuthorEmail":"","itemAuthorLatest":"","itemAuthorLatestLimit":"","itemRelated":"","itemRelatedLimit":"","itemRelatedTitle":"","itemRelatedCategory":"","itemRelatedImageSize":"","itemRelatedIntrotext":"","itemRelatedFulltext":"","itemRelatedAuthor":"","itemRelatedMedia":"","itemRelatedImageGallery":"","itemK2Plugins":""}', 'Преимущества натяжных потолков - быстрота монтажа, легкость демонтажа, разнообразие и богатство дизайна, экологичность', 'robots=\nauthor=', 'преимущества натяжных потолков, монтаж натяжных потолков, демонтаж натяжных потолков, дизайн натяжных потолков', '', '*');
INSERT INTO `wyz3q_k2_items` (`id`, `title`, `alias`, `catid`, `published`, `introtext`, `fulltext`, `video`, `gallery`, `extra_fields`, `extra_fields_search`, `created`, `created_by`, `created_by_alias`, `checked_out`, `checked_out_time`, `modified`, `modified_by`, `publish_up`, `publish_down`, `trash`, `access`, `ordering`, `featured`, `featured_ordering`, `image_caption`, `image_credits`, `video_caption`, `video_credits`, `hits`, `params`, `metadesc`, `metadata`, `metakey`, `plugins`, `language`) VALUES
(70, 'Натяжные потолки Clipso', 'natyazhnie-potolki-clipso', 1, 1, '<p><strong>Натяжные потолки Clipso</strong> созданы французской фирмой в 1997 году. Главной целью компании было создание цельного бесшовного полотна, с высоким сроком службы. Так в ближайшее время было представлено рынку, новое термоусадочное полотно.</p>\r\n<p>Характеристики, нового материала, превосходили по всем параметрам знаменитый потолок из виниловой пленки. Новинка была выполнена из специальной ткани с пропиткой полиуретана. Еще одно преимущество при установке это ширина ткани, которая составляет 5.1 метр.</p>\r\n<p>Благодаря новой ширине ткани, отпала необходимость сварки полотен. Кроме этого, материал экологичен, быстро и легко устанавливается. Новые технологии и высокие технические характеристики, сделали компанию лидером на рынке натяжных потолков. Оставляя позади, мокрые методы обделки и более современные конструкции из гипсокартона и ПВХ.</p>\r\n<p>На рынке Беларуси полотна Clipso появились всего пару лет назад. Но уже успели занять лидирующую позицию. Технические преимущества и высокий дизайнерский интерьер потолков Клипсо, зарекомендовали себя как наилучшее решение для любого помещения.</p>\r\n', '\r\n<p>Натяжные потолки Клипсо, имеют ряд достоинств и преимуществ.</p>\r\n<p>1. Максимальная экологическая безопасность. Полотно не накапливает различные запахи. Не обладает вредными веществами, которые загрязняют воздух в помещении. Это дает возможность широко применять полотно. Например, в детских учреждениях или лечебных центрах.</p>\r\n<p>2. Легкость в применении и быстрота монтажа. Шестьдесят квадратных метров, возможно, установить за один день с помощью двух монтажников. Работу можно выполнять, не вынося мебели из помещения. Полотно не требуется нагревать и выравнивать, что уменьшает время на подготовку. По окончании работы отсутствует грязь и мусор.</p>\r\n<pre>Компания Фолиан Строй производит монтаж натяжных потолков Clipso максимально быстро. Наши мастера помогут Вам воплотить в жизнь самые смелые дизайнерские решения и придать потолкам в Вашей квартире эфектный и законченный вид.</pre>\r\n<p>3. Устанавливаются как на стенах, так и на потолках. Возможность мыть водой.</p>\r\n<p>4. Широкий дизайнерский ассортимент, дает возможность установки потолков в любое помещение.</p>\r\n<p>5. Потолки Клипсо, можно купить разного дизайна с влагостойкими, антибактериальными свойствами.</p>\r\n<p>Шикарный вид и хорошие эксплуатационные качества, минимум дискомфорта при монтаже полотна, принесли популярность Clipso и в Беларуси. Бесшовные натяжные потолки постепенно вытесняют другие варианты обделки потолка.</p>\r\n<h3>Натяжные тканевые потолки Clipso и их характеристика.</h3>\r\n<p>В настоящее время используется три вида тканей от французского производителя потолков.</p>\r\n<h4>Стандартные ткани</h4>\r\n<p>Потолки Клипсо преимущественно белого или матового цвета. Материал, с которого они выполнены, пропитан полиуретаном, что придает высокую прочность. Способность переносить высокие температуры от -45 до +65 градусов. Установление потолков возможно даже на севере в помещениях без отопления.</p>\r\n<p>Также полотно не поддается деформации при высоких температурах и в комнатах с повышенной влажностью. Все полотна производятся в стандартных размерах, ширина которых составляет от 300 до 510 метра.</p>\r\n<h4>Акустические ткани</h4>\r\n<p>Акустические натяжные потолки – это материал с мелкой перфорацией. Невооруженным взглядом этой особенности полотна не разглядеть. Даже если всматриваться возникает впечатление цельного натяжного потолка. Эта методика разработана специалистами фирмы, для обеспечения максимальной шумоизоляции.</p>\r\n<p>Акустическое полотно полностью устраняет эхо. Повышает комфорт в помещениях для прослушивания музыки или просмотров фильма. Также потолок устанавливается в помещениях, где находится большое количество людей и в спорткомплексах. Во всех учреждениях, где необходимо убрать посторонние звуки.</p>\r\n<h4>Цветные ткани</h4>\r\n<p>Технические характеристики полностью соответствуют стандартному полотну. На рынке России, также можно приобрести цветные потолки от Clipso. И создать в помещении интерьер, воплотив в реальность любые мечты и фантазии.</p>\r\n<h3>Как устанавливаются натяжные потолки Клипсо.</h3>\r\n<p>Бесшовные потолки имеют специальную крепежную систему. Что позволяет легко и без затраты большого количества времени, сделать установку потолка.</p>\r\n<h4>Можно выделить несколько основных этапов установки:</h4>\r\n<p>- монтаж багетов на потолке или стенах; - прикрепление ткани в багет, используя шпатель Clipso; - натяжка полотна; - обрезание лишних кусков и избавление от морщин.</p>\r\n<p>Все настолько просто, что можно без проблем всю работу выполнить самостоятельно. Но лучше довериться рукам специалистов. Любой изъян, допущенный владельцем при установке, может снизить срок службы потолка. К примеру, плохое закрепление материи, перекос или чрезмерная натяжка. Люди, выполняющие эту работу профессионально, сделают установку наилучшим образом.</p>\r\n<h3>Как правильно ухаживать за натяжным потолком?</h3>\r\n<p>Высокая влагостойкость позволяет удерживать значительное количество влаги. Даже если вас пытаются затопить соседи сверху, ремонт в квартире не пострадает, благодаря хорошему полотну Клипсо. Для ухода можно использовать любые моющие средства. Исключением является все абразивные вещества. Нужно нанести на салфетку моющее средство и протереть полотно. От трудно выводимых пятен легко избавиться с помощью медицинского спирта.</p>\r\n<h3>Стоимость натяжных потолков Клипсо</h3>\r\n<p>Натяжные потолки фирмы Clipso совместили в себе две приятных вещи, это доступные цены и очень хорошее качество. Установив, потолок, вы забудете о его обновлении минимум на 10 лет. Это кстати и гарантийный срок от производителя.</p>\r\n<p>Цена учитывает услуги монтажников, которые непосредственно выполняют установку и стоимость материала. Цена одного погонного метра зависит от выбранной ширины полотна, цвета. И еще от таких параметров как звукопоглощение, нанесение фотопечати. Все дополнительные атрибуты будут увеличивать стоимость полотна.</p>\r\n<h3>Средние цены по Беларуси на натяжные потолки Clipso</h3>\r\n<p>Расчет стоимости производится за один квадратный метр полотна:</p>\r\n<ul>\r\n<li>белое полотно 17 евро;</li>\r\n<li>цветное полотно 20 евро;</li>\r\n<li>акустическое полотно 20 евро;</li>\r\n<li>полотно - антигрязь 20 евро;</li>\r\n<li>полотно - антивлага 20 евро;</li>\r\n<li>антибактерицидное полотно 22 евро;</li>\r\n<li>крепежные материалы 5 евро.</li>\r\n</ul>\r\n<p>Расчет осуществляется в зависимости от геометрии помещения. Подсчитывается количество углов и высота помещения. Чем сложнее конструкция помещения, тем больше будет стоимость. Также учитывается количество светильников.</p>\r\n<p>Окончательные цены вам укажут, только после выбора полотна. Произведения замеров и насколько сложные будут монтажные работы, в связи с особенностями помещения.</p>', NULL, NULL, '[{"id":"1","value":""},{"id":"2","value":""},{"id":"3","value":""}]', '   ', '2014-04-23 08:28:33', 572, '', 902, '2014-07-08 09:21:11', '2014-04-23 08:56:04', 902, '2012-11-06 12:40:30', '0000-00-00 00:00:00', 0, 1, 6, 0, 2, 'Натяжные потолки Клипсо', 'Фолиан Строй', '', '', 314, '{"catItemTitle":"","catItemTitleLinked":"","catItemFeaturedNotice":"","catItemAuthor":"","catItemDateCreated":"","catItemRating":"","catItemImage":"","catItemIntroText":"","catItemExtraFields":"","catItemHits":"","catItemCategory":"","catItemTags":"","catItemAttachments":"","catItemAttachmentsCounter":"","catItemVideo":"","catItemVideoWidth":"","catItemVideoHeight":"","catItemAudioWidth":"","catItemAudioHeight":"","catItemVideoAutoPlay":"","catItemImageGallery":"","catItemDateModified":"","catItemReadMore":"","catItemCommentsAnchor":"","catItemK2Plugins":"","itemDateCreated":"","itemTitle":"","itemFeaturedNotice":"","itemAuthor":"","itemFontResizer":"","itemPrintButton":"","itemEmailButton":"","itemSocialButton":"","itemVideoAnchor":"","itemImageGalleryAnchor":"","itemCommentsAnchor":"","itemRating":"","itemImage":"","itemImgSize":"","itemImageMainCaption":"","itemImageMainCredits":"","itemIntroText":"","itemFullText":"","itemExtraFields":"","itemDateModified":"","itemHits":"","itemCategory":"","itemTags":"","itemAttachments":"","itemAttachmentsCounter":"","itemVideo":"","itemVideoWidth":"","itemVideoHeight":"","itemAudioWidth":"","itemAudioHeight":"","itemVideoAutoPlay":"","itemVideoCaption":"","itemVideoCredits":"","itemImageGallery":"","itemNavigation":"","itemComments":"","itemTwitterButton":"","itemFacebookButton":"","itemGooglePlusOneButton":"","itemAuthorBlock":"","itemAuthorImage":"","itemAuthorDescription":"","itemAuthorURL":"","itemAuthorEmail":"","itemAuthorLatest":"","itemAuthorLatestLimit":"","itemRelated":"","itemRelatedLimit":"","itemRelatedTitle":"","itemRelatedCategory":"","itemRelatedImageSize":"","itemRelatedIntrotext":"","itemRelatedFulltext":"","itemRelatedAuthor":"","itemRelatedMedia":"","itemRelatedImageGallery":"","itemK2Plugins":""}', 'Натяжные потолки Клипсо - это отсутствие швов и простота монтажа', 'robots=\nauthor=', 'Натяжные потолки Клипсо,', '', '*');
