(189, 'Шапка сайта', '', '<h1 style="color: #a3780c; text-shadow: 1px 1px 2px black, 0 0 1em white;">Цены на потолоки от 112000 рублей</h1>\r\n<p>&nbsp;</p>\r\n<h2>При заказе натяжного потолка с сайта скидка 9% до 01.05.2015</h2>\r\n<p><img src="images/banners/potolok-akcia.png" class="callcons_b" width="500" height="149" alt="Акция на натяжные потолки в Минске" />\r\n</p>\r\n<h3 style="color: #00cc00; text-shadow: 1px 1px 2px black, 0 0 1em white;"><strong>9 лет</strong> на рынке натяжных потолков!</h3>\r\n<h3 style="color: #00cc00; text-shadow: 1px 1px 2px black, 0 0 1em white;"><strong><!-- BODY START HERE -->\r\n\r\n<SCRIPT language=JavaScript>\r\n<!--\r\nd0 = new Date(''December 22, 2006''); // дата запуска сайта (месяц должен быть на английском!)\r\nd1 = new Date();\r\ndt = (d1.getTime() - d0.getTime()) / (1000*60*60*8);\r\ndocument.write('''' + Math.round(dt) + ''''); // счетчик дней\r\n-->\r\n</SCRIPT>\r\n\r\n<!-- BODY END HERE --></strong>&nbsp;довольных заказчиков!</h3>', 1, 'header', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0"}', 0, '*'),
(190, 'Натяжные потолки от Фолиан Строй', '', '<p class="gkCentered">Заказать установку натяжного потолока можно за три простых шага!</p>\r\n<ol>\r\n	<li class="gkCentered" style="text-align: left;">Узнать ориетнировочную стоимость работ и материалов при помощи онлайн <a href="index.php?option=com_wrapper&amp;view=wrapper&amp;Itemid=114" title="Калькулятор натяжных потолков">калькулятора натяжных потолков</a>.</li>\r\n	<li class="gkCentered" style="text-align: left;">Получить <strong>бесплатную консультацию</strong> по вариантам дизайна и изготовлению натяжных потолков по <a href="#" class="callcons_b">телефону</a> и согласовать время визита нашего специалиста для проведения замеров.</li>\r\n	<li class="gkCentered" style="text-align: left;"><strong>Через 24 часа</strong> после заказа бригада квалифицироанных монтажников установит натяжные потолки в соответствии с выбранным дизайном.</li>\r\n</ol>\r\n<div class="gkIcons">\r\n	<div>\r\n		<div class="gkIconArea"><a class="gkCrop" href="home/cena-natiazhnogo-potolka.html">Стоимость потолка</a>\r\n		</div>\r\n		<h2>Цена натяжного потолка</h2>\r\n		<p>Воспользуйтесь калькулятором на сайте для расчета приблизительной стоимости установки натяжных потолков. Цена зависит от выбранных материалов, дизайнерского решения и сложности установки. Точную цену натяжного потолка можно узнать только вызвав специалиста - шаг 2.</p>\r\n	</div>\r\n	<div>\r\n		<div class="gkIconArea"><a class="gkRocket" href="home/zakaz-natiazhnoi-potolok.html">Дизайн натяжного потолка</a>\r\n		</div>\r\n		<h2>Выбор натяжного потолка</h2>\r\n		<p>Позвоните по телефону <a href="tel:+375297727726"><strong>+375 29 772 7726</strong></a> или <a href="tel:+375447727728"><strong>+375 44 772 7728</strong></a> для вызова на дом специалиста. В удобное для Вас время он произведет необходимые замеры и предложит варианты материалов и дизайна натяжных потолков. Так же необходимо согласовать срок изготовления полотен (обычно 24 часа) и дату установки - шаг 3.</p>\r\n	</div>\r\n	<div>\r\n		<div class="gkIconArea"><a class="gkMobile" href="blog-o-natiazhnih-potolkah.html">Монтаж натяжных потолков</a>\r\n		</div>\r\n		<h2>Установка натяжного потолка</h2>\r\n		<p>Бригада квалифицированных монтажников произведет <strong>установку натяжных потолков</strong> в соответствии с утвержденным проектом. Длительность монтажа натяжного потолка зависит от сложности и объема работ по установке. <em>Мы даем гарантию на все виды работ по установке натяжных потолков!</em>\r\n		</p>\r\n	</div>\r\n</div>', 1, 'mainbody', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"centered","cache":"1","cache_time":"900","cachemode":"static","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0"}', 0, '*'),
(191, 'Мы делаем настоящие потолки', '', '<p class="gkCentered">Что такое натяжной потолок? Это лучшее отделочное средство, которое сделает ваш интерьер красивым, современным, уютным при минимуме затрат и максимуме практической пользы.</p>\r\n<div class="gkHorizontalSlide">\r\n	<div class="gkHorizontalSlideLeftColumn">\r\n		<h2>Натяжные потолки в Минске и Слуцке - цены ниже!</h2>\r\n		<p>Еще недавно красивые натяжные потолки считались атрибутом элитного жилья. Но с развитием технологий такая отделка стала более доступной, сохранив при этом свои замечательные свойства. Сейчас каждый может заказать красивые, ровные, практичные, простые в уходе натяжные потолки недорого. Мы устанавливаем потолки различных фактур и цветов: бесшовные матовые, сатиновые, глянцевые, белые и цветные, тканевые потолки под ключ.</p>\r\n		<p>Нам доверяют более 80 000 клиентов по всей Беларуси</p>\r\n		<p><a class="button" href="index.php?option=com_contact&amp;view=contact&amp;catid=10&amp;id=1-folian-stroy&amp;Itemid=135">Заказать потолок</a>\r\n		</p>\r\n	</div>\r\n	<div class="gkHorizontalSlideRightColumn"><img src="images/natyazhnoi-potolok-slutsk.jpg" alt="natyazhnoi-potolok-slutsk" width="739" height="701" />\r\n	</div>\r\n</div>', 1, 'bottom1', 902, '2014-05-19 06:01:48', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"centered","cache":"1","cache_time":"900","cachemode":"static","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0"}', 0, '*'),
(192, 'Наши лучшие предложения __*__', '', '<p class="gkCentered">Акция!!! Белые глянцевые бесшовные потолки по цене белых матовых.</p>\r\n<p>Акция !!! При заказе натяжных потолков с монтажом точечных светильников - светильники в подарок*.</p>\r\n<p>Акция !!! При установке потолков во всей квартире, потолки в ванную комнату в подарок.</p>\r\n<p>{loadposition news_gallery}</p>\r\n<p class="gkDisclaimer"><strong>*</strong> При изготовлении натяжных потолков используются только проверенные временем и сертифицированные материалы!</p>', 1, 'bottom2', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"centered","cache":"1","cache_time":"900","cachemode":"static","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0"}', 0, '*'),
(194, 'Заказывайте потолки у производителя', '', '<div class="gkTextBlock">\r\n<h2>Заказывайте натяжные потолки <br />у производителя</h2>\r\n<p>Мы с удовольствием поможем вам воплотить в жизнь любую идею по реконструкции вашего старого потолочного покрытия. В нашем арсенале более 130 расцветок ПВХ и тканевых полотен разных производителей (Франция, Бельгия, Германия, Италия, Швейцария, Россия).</p>\r\n</div>\r\n<p><img src="templates/gk_simplicity/images/demo/manufacturers.png" alt="Установка натяжных потолков" /><img class="gkImageBlock" src="templates/gk_simplicity/images/demo/folian_potolki.png" alt="Натяжные потолки от производителя" /></p>', 1, 'bottom3', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"layered","cache":"1","cache_time":"900","cachemode":"static","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0"}', 0, '*'),
(198, 'Отзывы наших заказчиков и партнеров', '', '<p class="gkCentered">Отзывы наших заказчиков и партнеров о натяжных потолках "Фолиан Строй".</p>\r\n<div class="gkTestimonials">\r\n<div><img src="templates/gk_simplicity/images/demo/avatar-1.png" alt="Robert Gavick" /> <q>Фантастическое качество работ и материалов! Так держать, ребята!</q></div>\r\n<div><img src="templates/gk_simplicity/images/demo/avatar-2.png" alt="Paulina Nowakowska" /> <q>Заказала потолок только в одну комнату, но узнав о скидках и подарках - заказала еще в одну. И не пожалела - в подарок получила натяжной потолок в туалет!!!</q></div>\r\n<div><img src="templates/gk_simplicity/images/demo/avatar-3.png" alt="Tomasz Dziuda" /> <q>Очень доволен работой монтажников. Молодые ребята сделали все очень аккуратно и быстро. Рекомендую.</q></div>\r\n</div>', 1, 'bottom4', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"centered testimonials","cache":"1","cache_time":"900","cachemode":"static","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0"}', 0, '*'),
(199, 'Цена на потолки - всем по-карману', '', '<p class="gkCentered">Наши цены порадуют заказчика с любым бюджетом. Большой выбор материалов для натяжных потолков позволяет подобрать для каждого заказчика приемлемый вариант</p>\r\n<div class="gkPriceTable gkPriceTableAnimated col3"><dl><dt>Дешево</dt><dd class="gkPrice">99000<small>/ метр кв.</small></dd><dd>Швейцарские полотна Clipso</dd><dd>Немецкие натяжные потолки Descor</dd><dd>Итальянские натяжные потолки Cerutti</dd><dd>Бельгийские полотна PTMC Polyplast</dd><dd><a href="home/cena-natiazhnogo-potolka.html">Заказать</a></dd></dl><dl class="gkPremium"><dt>Эксклюзив</dt><dd class="gkPrice">399000<small>/ метр</small></dd><dd>Швейцарские полотна Clipso</dd><dd>Немецкие натяжные потолки Descor</dd><dd>Бельгийские полотна PTMC Polyplast</dd><dd>Итальянские натяжные потолки Cerutti</dd><dd>Монтаж бесплатно!</dd><dd><a href="home/cena-natiazhnogo-potolka.html">Заказать</a></dd></dl><dl><dt>Качественно</dt><dd class="gkPrice">270000<small>/ метр</small></dd><dd>Бельгийские полотна PTMC Polyplast</dd><dd>Немецкие натяжные потолки Descor</dd><dd>Итальянские натяжные потолки Cerutti</dd><dd>Бельгийские полотна PTMC Polyplast</dd><dd><a href="home/cena-natiazhnogo-potolka.html">Заказать</a></dd></dl></div>\r\n<p class="gkCentered">Найдите где еще дешевле, качественнее и быстрее изготавливают натяжные потолки и получите скидку!</p>', 1, 'bottom5', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"centered","cache":"1","cache_time":"900","cachemode":"static","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0"}', 0, '*'),
(200, ' Гарантия 10 лет от производителя', '', '<div class="gkButtonArea">\r\n	<h3>Гарантия на полотно натяжного потолка - 10 лет от производителя</h3><a href="http://folian.by/home/zakaz-natiazhnoi-potolok.html">Заказать</a>\r\n</div>', 1, 'bottom6', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0"}', 0, '*'),
